;; <=

;; **
;;; We will use our simple example rules again from Part 1 of the tutorial:
;; **

;; @@
(list 
 (rule hello []
   (create 
     (node :Hello)))

(rule world []
   (read 
      (node h:Hello)
      (NAC 
       (node wn:World)
       (edge :to h wn )
       ))
   (create 
      (node w:World)
      (edge :to h w ))))
