;; **
;;; The example below shows a program that creates a graph with five `Hello` nodes and applies the `world` rule until constraint `if-hello-then-to-world!` is met.
;; **

;; @@
(-> (newgrape) 
  (->n* 5 hello)
  (->*? if-hello-then-to-world! world#) view)
;; @@
