;; **
;;; The rule below defines the Sirpinski refinement step for a single triangle:
;; **

;; @@
(rule step []
      (read (node c1:Corner)
              (node c2:Corner)
              (node c3:Corner)
              (node t1:Triangle)
              (edge le:left t1 c1)
              (edge re:right t1 c2)
              (edge :top t1 c3))
      (delete le re)
      (create (node tl:Triangle)
              (node tr:Triangle)
              (node l:Corner)
              (node r:Corner)
              (node b:Corner)
              ; rewire matched triangle
              (edge :left t1 l)
              (edge :right t1 r)
              ; wire new left triangle
              (edge :top tl l)
              (edge :left tl c1)
              (edge :right tl b)
              ; wire new right triangle
              (edge :top tr r)
              (edge :left tr b)
              (edge :right tr c2)
              ))
;; @@
